import MeetingsImg from "../../../../../pics/profile.jpeg";
import { NavLink } from "react-router-dom";
import { Nav, Tab } from "react-bootstrap";
import React from "react";
import { PageInnerTitle } from "../../../../common/ManagerComponents/pageInnerTitle/Title";
import { BiLink } from "react-icons/bi";
import { AiOutlineMessage, AiOutlineClose } from "react-icons/ai";
import { MdOutlineReviews, MdOutlineClose } from "react-icons/md";
import { useState } from "react";
import Calendar from "react-calendar";
import { useNavigate } from "react-router-dom";
import { BsPlus } from "react-icons/bs";
import { RiDeleteBin6Line } from "react-icons/ri";
import { Modal } from "react-bootstrap";
import { InputBox } from "../../../../common/ManagerComponents/form/Form";
export const Index = () => {
  return (
    <>
      <WelcomeNote
        name="Shived"
        text="Lets do the best today"
        data={<FullBtn link="/" name="Add Project" />}
      />
      <ProjectSummary />
      <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3 ">
        <div className="col-xxl-8 col-xl-8 col-lg-8 col-md-12 col-sm-12 col-12">
          <div className="row g-xxl-4 g-xl-4 g-lg-4 g-md-4 g-sm-3 g-3">
            <div className="col-12">
              <ProjectListApp />
            </div>
            <div className="col12">
              <MeetingsList />
            </div>
